const App = () => {
  return(
      <div className='site-wrapper'>
        <Header/>
        <Nav/>
        {/*<Cont/>*/}
        <div className='site-wrapper-content'>
            <Dialogs/>
        </div>
      </div>
  );

}

export default App;
